import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';
import { Link, useNavigate } from 'react-router-dom';
import UserContext from '../context/UserContext';
import { useContext } from 'react';

// Define all possible pages
const allPages = ['Dashboard', 'About'];
const settings = ['Login', 'Signup'];

function Navbar() {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [anchorElUser, setAnchorElUser] = React.useState(null);
  let Navigate = useNavigate()
  let context = useContext(UserContext)
  const { user, logout } = context

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const logoutProcess = async () => {
    await logout();
    Navigate('/');
  };

  return (
    <AppBar position="static" color='primary'>
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          {/* Left side - Navigation links (hidden on mobile) */}
          <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' }, alignItems: 'center' }}>
            {/* Centered Logo - moved to left when user is logged in */}
            <Typography
              variant="h6"
              noWrap
              component={Link}
              to="/"
              sx={{
                mr: 2,
                fontWeight: 700,
                letterSpacing: '.1rem',
                fontSize: "1.6rem",
                color: 'inherit',
                textDecoration: 'none',
              }}
            >
              iNoteBook
            </Typography>

            {/* Show navigation links only when user is logged in */}
            {user && (
              <Box sx={{ display: 'flex', ml: 2 }}>
                {allPages.map((page) => (
                  <Button
                    key={page}
                    component={Link}
                    size='small'
                    to={`/${page.toLowerCase()}`}
                    onClick={handleCloseNavMenu}
                    sx={{ 
                      mx: 1, 
                      color: 'white',
                    }}
                  >
                    {page}
                  </Button>
                ))}
              </Box>
            )}
          </Box>

          {/* Mobile menu button - only show when user is logged in */}
          {user && (
            <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
              <IconButton
                size="large"
                aria-label="account of current user"
                aria-controls="menu-appbar"
                aria-haspopup="true"
                onClick={handleOpenNavMenu}
                color="inherit"
              >
                <MenuIcon />
              </IconButton>
              <Menu
                id="menu-appbar"
                anchorEl={anchorElNav}
                anchorOrigin={{
                  vertical: 'bottom',
                  horizontal: 'left',
                }}
                keepMounted
                transformOrigin={{
                  vertical: 'top',
                  horizontal: 'left',
                }}
                open={Boolean(anchorElNav)}
                onClose={handleCloseNavMenu}
                sx={{ display: { xs: 'block', md: 'none' } }}
              >
                {allPages.map((page) => (
                  <MenuItem 
                    key={page} 
                    onClick={handleCloseNavMenu}
                    component={Link}
                    to={`/${page.toLowerCase()}`}
                  >
                    <Typography textAlign="center">{page}</Typography>
                  </MenuItem>
                ))}
              </Menu>
            </Box>
          )}

          {/* Right side - Auth buttons */}
          <Box sx={{ display: 'flex', justifyContent: 'flex-end' }}>
            {!user ? (
              <Box sx={{ display: 'flex', gap: 1 }}>
                <Button
                  variant="outlined"
                  size='small'
                  color="inherit"
                  component={Link}
                  to="/login"
                  sx={{ textTransform: 'none' }}
                >
                  Login
                </Button>
                <Button
                  variant="contained"
                  size='small'
                  color="secondary"
                  component={Link}
                  to="/signup"
                  sx={{ textTransform: 'none' }}
                >
                  Signup
                </Button>
              </Box>
            ) : (
              <Button
                variant="outlined"
                size='small'
                color="inherit"
                sx={{ textTransform: 'none' }}
                onClick={logoutProcess}
              >
                Logout
              </Button>
            )}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
}

export default Navbar;
